  async addEditPolice(edit?: any) {
    // console.log('on add')
    this.submitted = true
    if (!this.addeditform.valid) {
      // this.toastr.error('Form is invalid')
      return
    }
    else {
      if (edit == 'edit') {
        this.addeditform.value.police_id = this.police_id
      }
      this.addeditform.value.latitude = Number(this.addeditform.value.latitude)
      this.addeditform.value.longitude = Number(this.addeditform.value.longitude)

      this.addeditform.value.user_id = this.user_id
      let result = await this.http.post(this.apiurl.url.addEditPoliceData, this.addeditform.value)
      if (result['message'] == 'Wrong authorization' || result['message'] == 'Session is expired please login again') {
        localStorage.clear()
        this.router.navigateByUrl("/sessions/signin")
        this.toastr.error(result['message'])
      }
      if (result['status']) {
        this.addeditform.reset()
        this.submitted = false
        this.modalService.dismissAll();
        this.police = result['data']
        this.toastr.success(result['message'])
      }
      else {
        this.toastr.error(result['message'])
        this.modalService.dismissAll();
      }
    }
    this.mapInit();
  }
